import logo from './logo.svg';
import './App.css';
import Data from './views/Data';
import Main from './views/Main'
import { Router } from '@reach/router';
function App() {
  return (
    <div className="App">
      <Router>
        <Main path="/" />
        <Data path="/dashboard" />
      </Router>
    </div>
  );
}

export default App;
